import React from 'react'

const ProjectList = ({projects}) => {
return(
  projects.map(p => {
    return(
      <div key={p.id}>
        <label>{p.name}</label>
        <p>Description:{p.description}</p>
        <p>Utilized tools:{p.tool}</p>
      </div>)})
)}
export default ProjectList;
